import React, { Component } from 'react';
import {
    MDBContainer,
    MDBRow,
    MDBCol
} from 'mdbreact';
import styled from 'styled-components';

const Wrapper = styled.div`
    height: 150px;
    margin-bottom: 30px;
    // border: 1px solid red;

    .image-container-left {
        height: 150px;
        padding: 0px;
    }

    .image-container-right {
        height: 150px;
        padding: 0px;
        text-align: right;
    }

    .image {
        border: 1px solid red;
        border-radius: 10px;
        width: 90%;
        box-shadow: 2px 5px 410x 2px grey;
    }
`;

export class FeatureCardLeft extends Component {
    render() {
        return (
            <Wrapper>
                <MDBContainer>
                    <MDBRow>
                        <MDBCol size="4" className="image-container-left">
                            <img className="image" src="https://cdn-image.foodandwine.com/sites/default/files/1501607996/opentable-scenic-restaurants-marine-room-FT-BLOG0818.jpg" />
                        </MDBCol>
                        <MDBCol size="8">
                            <MDBRow>
                                TELL YOUR STORY
                            </MDBRow>
                            <MDBRow>
                                Share your origins and journeys with the world, and teach customers about your culture!
                            </MDBRow>
                        </MDBCol>
                    </MDBRow>
                </MDBContainer>
            </Wrapper>
        );
    }
}

export class FeatureCardRight extends Component {
    render() {
        return (
            <Wrapper>
                <MDBContainer>
                    <MDBRow>
                        <MDBCol size="8">
                            <MDBRow>
                                TELL YOUR STORY
                            </MDBRow>
                            <MDBRow>
                                Share your origins and journeys with the world, and teach customers about your culture!
                            </MDBRow>
                        </MDBCol>
                        <MDBCol size="4" className="image-container-right">
                            <img className="image" src="https://cdn-image.foodandwine.com/sites/default/files/1501607996/opentable-scenic-restaurants-marine-room-FT-BLOG0818.jpg" />
                        </MDBCol>
                    </MDBRow>
                </MDBContainer>
            </Wrapper>
        );
    }
}
